.syntax unified
.thumb

	
	/* ------------------------------- Rotary Config ---------------------------------------------*/
	
	.equ Radios,			240			@ Radio number of image
	.equ LPTMR0_CMR_INIT,	1000	    @ Delay between radios
	
	/*--------------------------------------------------------------------------------------------*/
	
	
	
	
	/*------------------------------------- Labels -----------------------------------------------*/
	

	/* Clock enable, port  A, Port B, and LPTMR */
	
	.equ SIM_SCGC5,		0x40048038
	.equ SIM_SCGC5_INIT,	0xc01
	
	
	/* Configure pins port_C[0:15] and Port_B[16:23] as GPIO, Drive Strength */
	 
	.equ PORTC_GPCLR, 		0x4004B080 
	.equ PORTC_GPCLR_INIT,  0xFFFF0140
	
	.equ PORTB_GPCHR, 		0x4004A084 
	.equ PORTB_GPCHR_INIT,	0xFF0140
		
	.equ PORTC_PCR16		,0x4004B040
	.equ PORTC_PCR16_INIT	,0x1090102
	
	
	/* Enable port B, port C, as output and PORT C 16 as Input */
	
	.equ GPIOC_PDDR ,		0x400FF094
	.equ GPIOC_PDDR_INIT ,	0x0FFFF
	
	.equ GPIOB_PDDR , 		0x400FF054 
	.equ GPIOB_PDDR_INIT, 	0x00FF0000
	
	
	/* 1Khz Clock with bypass */
	
	.equ  LPTMR0_PSR,		 0x40040004 
	.equ  LPTMR0_PSR_INIT,	 0x5
	
	
	/* LPTMR comparer*/
	
	.equ LPTMR0_CMR,		0x40040008 
		
	
	/* LPTMR as cycle counter, and enable interruptions*/
	
	.equ LPTMR0_CSR,		0x40040000 
	.equ LPTMR0_CSR_ON,	 	0xC1
	.equ LPTMR0_CSR_OFF,	0b11000000
	
	/* Adrress for clear and enable NVIC */
	
	.equ NVICICPR1,		 	0xE000E284 
	.equ NVICISER1,		 	0xE000E104 
	
	
	/* Masks for clear interruptions*/
	
	
	.equ IRQ61Mask		 	,0x20000000 	/* Hall interruption */
	.equ IRQ58Mask		 	,0x04000000		/* LPTMR Interruption */ 	
	.equ IRQAll,			0x24000000		/* All Interruptions */
	
		
	/* Adresses to write PORT_C and PORT_B */
	
	.equ GPIOC_PDOR,		0x400FF080
	.equ GPIOB_PDOR,		0x400FF040
	
	
	
	
	
	/* ---------------------------------- Program variables --------------------------------------*/
	
	 .data
	 .align 2 	
	 	 
	 RadioActual: 				.word 		0x00000000 
	 Flag_LPTMR:				.word    	0x0			
	 Flag_Hall:					.word      	0x0			
	 
	/* -------------------------------------------------------------------------------------------*/
	
	
 

	/*------------------------------------------ Main code ---------------------------------------*/
	
	
.text
.align 2	
.global	main
.type main function


	
main:

	/* The values of the previous variables are initialized */	 


	LDR r0,=RadioActual
	LDR r1,=#0
	STR r1,[r0]
	


	/* The values of the previous labels are initialized */


	/* CLOCK PORTS */

	LDR r0,=SIM_SCGC5
	LDR r1,=SIM_SCGC5_INIT
	STR r1,[r0]
	
	
	/* PORTS CONFIGURATION */
	
	LDR r0,=PORTC_GPCLR
	LDR r1,=PORTC_GPCLR_INIT
	STR r1,[r0] 
	
	LDR r0,=PORTC_PCR16
	LDR r1,=PORTC_PCR16_INIT
	STR r1,[r0] 
	
	LDR r0,=PORTB_GPCHR
	LDR r1,=PORTB_GPCHR_INIT
	STR r1,[r0] 
	
	
	/* PORTS INPUT OR OUTPUT */
	
	LDR r0,=GPIOC_PDDR
	LDR r1,=GPIOC_PDDR_INIT
	STR r1,[r0] 
	
	LDR r0,=GPIOB_PDDR
	LDR r1,=GPIOB_PDDR_INIT
	STR r1,[r0]
	
	
	/* LPTMR CONFIG */
		
	LDR r0,=LPTMR0_CMR 			
	LDR r1,=LPTMR0_CMR_INIT
	STR r1,[r0] 
	
	LDR r0,=LPTMR0_PSR
	LDR r1,=LPTMR0_PSR_INIT		
	STR r1,[r0] 
	
	LDR r0,=LPTMR0_CSR
	LDR r1,=LPTMR0_CSR_ON		
	STR r1,[r0]
		
	
	/* NVIC CONFIG */
			
 	LDR r0,=NVICICPR1
 	LDR r1,=IRQAll
 	STR r1,[r0]
	
	
	LDR r0,=NVICISER1
 	LDR r1,=IRQAll
 	STR r1,[r0]	
 	
	/* Save Image address in R8 */

	LDR r8,=Image     
	
	
	
	/*------------------------------------------ Main Loop -------------------------------------------*/

	
MainLoop:
	
	
	LDR r2,=RadioActual
	LDR r3,[r2]
	
	CMP r3,#Radios
	
	ITT HS
	LDRHS r8,=Image 
	LDRHS r7,[r8]
	
	B PintarRadio  	
	
	
		
	@LDRHS r7,=0x00000000  @ Para apagar los Leds
	@BEQ PintarLeds 		  @ Manda a apagar leds si los radios son mas de 120
			
	


	/*------------------------------------------ Sleep or paint radio ---------------------------------*/

	
PintarRadio:

	
	LDR r2,=Flag_LPTMR
	LDR r0,[r2]
	CMP r0,#0							/*Compare LPTMR_FLAG = 0*/
	
	BEQ Sleep  							/* Go to sleep if LPTMR_FLAG=0 */
						
	LDR r0,= Flag_LPTMR					/* Reset Flag_LPTMR*/
	LDR r1,=#0
	STR r1,[r0]
							
	B PintarLeds						/*Go to paint the radios */
		
		
	
	
	/*------------------------------------------ Paint the radio --------------------------------------*/

PintarLeds: 

	

	LDR r2,=GPIOC_PDOR  		/* The addresses and constants are loaded */
	LDR r3,=GPIOB_PDOR		
	
	LDR r5,=0xFFFFFFFF	
	LDR r6,=0x00000000

	MOV r4,#0            		/* Delay counter for reset sequence */
	

Res:
	
	str r6,[r2]					/* Reset the leds */
    str r6,[r3]	
	ADD r4,#1		
	NOP
	NOP
	NOP
	CMP r4,#170	
	
BNE Res
	
	
	
	
	MOV r4,#0            /* counter for sent words */
	

NoFinish:	
	LDR r7,[r8],#4		/* Load the word, and increase pointer */
		 		
    str r5,[r2]			/* Send 1*/
    str r5,[r3]
    
    nop
    nop			
    nop
	nop

    
    str r7,[r2]			/* Send Data */
    str r7,[r3]
     
    nop
    nop
    nop
    nop
    
    str r6,[r2]			/* Send 0 */
    str r6,[r3]
    
    nop
    nop
    nop
    nop
    nop
    
    ADD r4,#1 			
    CMP r4,#72			
    
BNE NoFinish			/* Go to send the next word, if the amount of sent bits has not been completed */
	
	B Sleep		




	/*------------------------------------------ Waiting for interruptions ----------------------------*/


Sleep:		
		WFI
		B MainLoop

	
	
	/*------------------------------------------Interruption attention sub-routines -------------------*/
	
	
	
	
	/*---------------------------------------- Hall Sensor interrupt ----------------------------------*/

	
.align 2
.global PORTC_IRQHandler
.type   PORTC_IRQHandler function

PORTC_IRQHandler:

	LDR r0,=PORTC_PCR16
	LDR r1,[r0]
	ORR r1,#0x1000000 
	STR r1,[r0]
							
	LDR r0,=LPTMR0_CMR	
	LDR r1,[r0]					/* Clear the interruption */
	 
	LDR r0,=RadioActual
	LDR r2, [r0]
	
	LDR r0,=Radios				/* Calculate the new value of the lptmr comparator */
	MUL r1,r2
	UDIV r1,r0
	

	LDR r0,=LPTMR0_CSR			/* disable LPTMR*/
	LDR r2,=LPTMR0_CSR_OFF		
	STR r2,[r0]
	

	LDR r0,=LPTMR0_CMR			/* Change Value of LPTMR CMR */
	STR r1,[r0]					
	
	
	LDR r0,=LPTMR0_CSR			/* Enable LPTMR*/
	LDR r2,=LPTMR0_CSR_ON		
	STR r2,[r0]
	
	
	LDR r0,=RadioActual
	LDR r1,=0
	STR r1,[r0]					/* Reset RadioActual to 0 */	
	
	dsb	
BX lr


	/*---------------------------------------- LPTMR interrupt ----------------------------------------*/


.align 2
.global LPTimer_IRQHandler
.type   LPTimer_IRQHandler function

LPTimer_IRQHandler:

	LDR r0,=LPTMR0_CSR
	LDR r1,[r0]
	
	ORR r1,#0x80  
	STR r1,[r0]					/* Clear the interruption */
	
	
	LDR r0,= Flag_LPTMR			/* LPTMR_FLAG = 1*/
	LDR r1,=#1
	STR r1,[r0]
	
	LDR r0,=RadioActual			/* Increase RadioActual */
	LDR r1, [r0]
	ADD r1,#1
	STR r1,[r0]
	
	dsb
BX lr
				
	

	/*---------------------------------------- Store the image -----------------------------------------*/
	
	
